import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import NotificationList from "./components/notifyy";
import NotificationDetail from "./components/NotificationDetail"; // ✅ Create this component

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<NotificationList />} />
        <Route path="/:booking_id" element={<NotificationDetail />} /> {/* ✅ Dynamic route */}
      </Routes>
    </Router>
  );
};

export default App;
